import { useState } from 'react'
import { useEffect } from 'react'
import moviesUtils from '../utils/moviesUtils'
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import MainComp from './main'

function HomeComp() {

  const [movies, setMovies] = useState([])

  useEffect(() => {
    async function fetchData() {
     let allMovies = await moviesUtils.allMovies();
     setMovies(allMovies.splice(0, 10)
     )}
    fetchData();
  }, []);

  return (
    <div className="App">
  <MainComp/>
 <ImageList sx={{ width: 500, height: 450 }} variant="woven" cols={3} gap={8}>
      {movies.map((item) => (
        <ImageListItem key={item._id}>
          <img
            src={`${item.Image}?w=161&fit=crop&auto=format`}
            srcSet={`${item.Image}?w=161&fit=crop&auto=format&dpr=2 2x`}
            alt={item.Name}
            loading="lazy"
          />
        </ImageListItem>
      ))}
    </ImageList>
    </div>
 
  )}

export default HomeComp;
